import React from 'react';
import { BrowserRouter as Router, Route, Routes, useLocation } from 'react-router-dom';
import Login from './components/Login';
import Register from './components/Register';
import Navbar from './components/Navbar';
import Home from './components/Home';
import About from './components/About';
import Class from './components/Class';
import Profile  from './components/Profile';

const App = () => {
  return (
    <Router>
      <Main />
    </Router>
  );
};

const Main = () => {
  const location = useLocation();

  // Tentukan apakah rute saat ini adalah login atau register
  const isAuthRoute = location.pathname === '/' || location.pathname === '/register';

  return (
    <div>
      {/* Tampilkan Navbar hanya jika bukan di rute login atau register */}
      {!isAuthRoute && <Navbar />}
      <Routes>
        <Route path="/register" element={<Register />} />
        <Route path="/" element={<Login />} />
        <Route path="/home" element={<Home />} />
        <Route path="/about" element={<About />} />
        <Route path="/class" element={<Class />} />
        <Route path="/profile" element={<Profile />} />
        <Route path="/detail/:courseId" element={<Detail />} /> {/* Add this route */}

      </Routes>
    </div>
  );
};

export default App;
